import React from "react";

import OpenWeatherScraper from "../components/OpenWeatherScraper";
import token from "./token";

function App() {
  return (
    <React.Fragment>
      <h1>Token: {token}</h1>
      <OpenWeatherScraper />
    </React.Fragment>
  );
}

export default App;
